  state = {};
  render() {
    return (
      <React.Fragment>
        <div style={{ paddingTop: 2, paddingBottom: 2 }}>
          <Button color="link">Write an article</Button>
        </div>
        <NewArticle></NewArticle>
        <ArticleThumbnail></ArticleThumbnail>
        <ArticleThumbnail></ArticleThumbnail>
        <ArticleThumbnail></ArticleThumbnail>
        <ArticleThumbnail></ArticleThumbnail>
        <ArticleThumbnail></ArticleThumbnail>
        <ArticleThumbnail></ArticleThumbnail>
        <ArticleThumbnail></ArticleThumbnail>
      </React.Fragment>
    );
  }
}

export default Main;
